test('Check lone carbons are hidden', function(){
	expect(12);
	var mol = new ChemDoodle.structures.Molecule();
	mol.atoms[0] = new ChemDoodle.structures.Atom();
	mol.atoms[1] = new ChemDoodle.structures.Atom('C', 0,1);
	mol.atoms[2] = new ChemDoodle.structures.Atom('C', 0,-1);
	mol.bonds[0] = new ChemDoodle.structures.Bond(mol.atoms[0], mol.atoms[1]);
	mol.bonds[1] = new ChemDoodle.structures.Bond(mol.atoms[0], mol.atoms[2]);
	mol.setupMetaData();
	ok(mol.atoms[0].isHidden, 'Center atom is hidden');
	ok(!mol.atoms[1].isHidden, 'First terminal atom is not hidden');
	ok(!mol.atoms[2].isHidden, 'Second terminal atom is not hidden');
	//change bond order
	mol.bonds[0].bondOrder = 2;
	mol.setupMetaData();
	ok(!mol.atoms[0].isHidden, 'Center atom is not hidden');
	ok(!mol.atoms[1].isHidden, 'First terminal atom is not hidden');
	ok(!mol.atoms[2].isHidden, 'Second terminal atom is not hidden');
	//change other bond order
	mol.bonds[1].bondOrder = 2;
	mol.setupMetaData();
	ok(mol.atoms[0].isHidden, 'Center atom is hidden again');
	ok(!mol.atoms[1].isHidden, 'First terminal atom is not hidden');
	ok(!mol.atoms[2].isHidden, 'Second terminal atom is not hidden');
	//change angle
	mol.atoms[2].x = 1;
	mol.atoms[2].y = 0;
	mol.setupMetaData();
	ok(!mol.atoms[0].isHidden, 'Center atom is not hidden');
	ok(!mol.atoms[1].isHidden, 'First terminal atom is not hidden');
	ok(!mol.atoms[2].isHidden, 'Second terminal atom is not hidden');
});

