test('Check the calculation of coordination numbers', function(){
	expect(6);
	var mol = new ChemDoodle.structures.Molecule();
	mol.atoms[0] = new ChemDoodle.structures.Atom();
	mol.atoms[1] = new ChemDoodle.structures.Atom();
	mol.atoms[2] = new ChemDoodle.structures.Atom();
	mol.bonds[0] = new ChemDoodle.structures.Bond(mol.atoms[0],mol.atoms[1]);
	mol.bonds[1] = new ChemDoodle.structures.Bond(mol.atoms[1],mol.atoms[2]);
	mol.check();
	mol.check(true);
    equal(1, mol.atoms[0].coordinationNumber, 'Check first terminal Carbon of propane');
    equal(2, mol.atoms[1].coordinationNumber, 'Check central Carbon of propane');
    equal(1, mol.atoms[2].coordinationNumber, 'Check second terminal Carbon of propane');
	mol.bonds[0].bondOrder = 2;
	mol.check();
	mol.check(true);
    equal(2, mol.atoms[0].coordinationNumber, 'Check first terminal Carbon of propene');
    equal(3, mol.atoms[1].coordinationNumber, 'Check central Carbon of propene');
    equal(1, mol.atoms[2].coordinationNumber, 'Check second terminal Carbon of propene');
});

